import React from 'react';
import $ from 'jquery';

export default class Test extends React.Component {
    constructor(props) {
      super(props);

      this.state = {
        firstName: "",
        lastName: ""
      }
    }

    render() {
      return (
        <div>
          <h1>{this.state.firstName} {this.state.LastName}</h1>
        </div>
      );
    }
}
